const Index = props => (
    <Layout>
        <h3>PROFIL MAHASISWA STIKOM PGRI BANYUWANGI</h3>
        <h4>Nama : Eka Hayunasruroh<br/>
        Tempat,Tgl Lahir : Banyuwangi, 22 Juni 2000<br/>
        Alamat : Jl. Kemiren Desa Banjarsari<br/>
        Pekerjaan : Mahasiswa/ Guru MTs<br/>
        Hobi : Membaca<br/>
        NIM : 1118101583<br/>
        JURUSAN : S1 TEKNIK INFORMATIKA - MALAM 2018
        </h4>
    </Layout>
);

export default Index;
